history.provenance:
A 200 once formed one half of a single manuscript, the other half of which is now no. 400 of Växjö stiftsbibliotek (formerly Kungliga gymnasi biblioteket), which hails from the Carthusian charterhouse of Salvatorberg in Erfurt; it is listed in their library catalogue as 112.2 (
                                Lehmann

                            ). According to a former librarian's note, the Växjö manuscript (no. 400) retains the original binding, which carries the Carthusian signum as well as a note on the purchase of the manuscript by George Stephens from a "Hr Schmidt, Bookseller" in Halle in . The original manuscript appears to have been intact when the library of book collector Friedrich Gottlieb Julius von Bülow was sold at auction in 1836 (


                            ). Presumably, the manuscript had come into von Bülow's possession earlier in the 19th century, when the charterhouse of Salvatorberg was secularized.

note.p:
               The authorship of the text is debated; it has been attributed to, among others, Denis the Carthusian. The date of A 200, however, proves that it cannot be by him (see 
    Emery 1991

).
